// src/pages/HomePage.js
import React from 'react';
import './HomePage.css';
import '../styles/global.css';

const HomePage = () => {
  return (
    <div className="home">
      <div className="banner">
        <h1>Welcome to Dubai Project</h1>
        <p>Enhancing Marketing and Cooperation in Dubai</p>
      </div>
      <div className="introduction">
        <h2>Introduction</h2>
        <p>Our project aims to address marketing challenges in Dubai by leveraging advanced technologies and fostering global cooperation.</p>
      </div>
      <div className="services">
        <h2>Our Services</h2>
        <ul>
          <li>Real Estate</li>
          <li>Medical Vacation</li>
          <li>Business Solutions</li>
        </ul>
      </div>
    </div>
  );
};

export default HomePage;
